'''Darkmeyer Lantern Shop''' is a store located in [[Darkmeyer]], owned by [[Grinka Krast]]. It sells a variety of [[light source]]s. [[Sins of the Father]] must be completed to access this store. It is one of four stores in Darkmeyer, and is located in the eastern section.

